import React from "react";

function Navbar() {
  return (
    <nav className="bg-blue-600 text-white px-8 py-4 flex justify-between items-center shadow-md">
      {/* Website Name / Logo */}
      <h1 className="text-2xl font-bold">DocMed</h1>

      {/* Navigation Links */}
      <div className="flex items-center space-x-6">
        <a href="#about" className="hover:text-gray-200">About Us</a>
        <a href="#departments" className="hover:text-gray-200">Departments</a>
        <a href="#membership" className="hover:text-gray-200">Membership</a>
        <a href="#help" className="hover:text-gray-200">Help</a>
        <a href="#contact" className="hover:text-gray-200">Contact</a>

        {/* Sign In Button */}
        <button className="ml-4 bg-white text-blue-600 px-4 py-2 rounded-md font-medium hover:bg-gray-100">
          Sign In
        </button>
      </div>
    </nav>
  );
}

export default Navbar;
